export const getData = async () =>{
    const reqOps = {
        method: 'GET',            
        headers: { 'Content-Type': 'application/json' }
    };

    const response = fetch(`http://localhost:5000`, reqOps)
    .catch(() => {return { msg:"No se pudo realizar la consulta al servidor.", status: false}});

    const datos = await response.then( json => json ).then(data => data)
    return datos
}
